Thy Flesh was initially formed back 2004, as a thrash metal band. In the years that followed however, the evolution was quite different

In 2004 the band released a demo titled &quot;Concept for the Devil&quot; which was accepted by fans and press as a unique piece of extreme metal. The project did quite well, as far as publicity was concerned. However, that crossover extreme metal trend that was very popular at the time was proved to be just a shot-term fluke.
After 2005 the band was disbanded and was officially re-formed in 2011 with only Athan as a member of the original line-up. The new direction is Black Metal with a touch of insanity to keep the wolves at bay. 
We promote vandalism, philosophy, esotericism, and black metal. We'll be right with you..
